const api = new XMLHttpRequest ();

let url, datos, validadorDeConsulta;
let participante, documento, tipo;

$( document ).ready(function() {

$( "#vDocumento" ).click(function() { determinarBusqueda (); $("#documento").focus(); });

$("#documento").keypress(function(e) { 
  let c = (e.keyCode ? e.keyCode : e.which);
  if(c == 13){ determinarBusqueda(); $("#documento").focus(); return false; } });

$("#documento").focus(); });

/*--------------------------------------------------------------------------------*/

function determinarBusqueda () {
  if ($("#documento").val() != "") { verificarCertificadoPDF (); }
  else { $("#resultados").html('¡Ups!, <b>¡no has ingresado documento!</b>'); } 
}

function verificarCertificadoPDF () {
  let idSheets = '1t--iVRkxM9aZk46jhV8r75qRwHf9eh9XjM0T9OoHk0w';
  let apiKey = 'AIzaSyAVvMA2r0J3skLgWq2g0JX6facQN9BXsXM';
  url = "https://content-sheets.googleapis.com/v4/spreadsheets/" + idSheets + "/values/A:C?access_token="+ apiKey +"&key="+ apiKey;
  api.open('GET',url,true);
  api.send();
  validadorDeConsulta = 0;
  $("#resultados").html("¡Tu petición está siendo procesada!, <b>por favor espera…</b>");
  $("#vDocumento").addClass("disabled");

  api.onreadystatechange = function () {
    if (this.status == 500) { sinResultados (); }
    else if (this.status == 200 && this.readyState == 4) {
      datos = JSON.parse (this.responseText);
      if (datos.values.length != '0') {
        let i = 0;
        while (i <= datos.values.length - 1) {
          if (datos.values[i][0] == $("#documento").val()) {
            validadorDeConsulta = 1;
            documento = datos.values[i][0];            
            participante = datos.values[i][1];
            generarCertificadoPDF ();
            $("#resultados").html("<b>¡Tu certificado ha sido generado!</b>");
            i = datos.values.length;
          }
          i++;
        }
      }
    }
    if (validadorDeConsulta == 0) { sinResultados (); }
    $("#vDocumento").removeClass("disabled"); }

  $("#documento").focus(); }

/*--------------------------------------------------------------------------------*/

function sinResultados () {
  $("#resultados").html('¡Ups!, <b>¡no hay resultados para el documento ingresado!.</b>'); }

function generarCertificadoPDF () {
  var doc = new jsPDF('l','cm',[25.4, 14.29]);
  let texto = ""; let url64 = "";


  function cen (x) {
    let textWidth = doc.getStringUnitWidth(x) * 
    doc.internal.getFontSize() / doc.internal.scaleFactor;
    return (doc.internal.pageSize.width - textWidth) / 2; }
  

  doc.setFontSize(16);
  doc.setFont("helvetica");
  doc.setFontType("bold");
  
  url64 = "data:image/jpeg;base64,";
  doc.addImage(url64, 'JPEG', 0, 0, 0, 0);
  texto = participante + ', C.I: ' + documento;
  doc.text(2, 6, texto);
  //texto = participante; doc.text(cen(texto), 7, texto);
  //texto = 'CI: ' + documento; doc.text(cen(texto), 8, texto);      
  
  doc.save('Certificado - ' + participante + ' (' + documento + ').pdf');
}